import React from 'react';
import style from '../Styles/Detail.module.css';
import profile from '../Images/download.jpg';

function Detail() {
  return (
    <div>
      
      <div id={style.wrap}>
        <hr/>
        <img className={style.bigprofile}
        src={profile} alt="profile"/>
      </div>
    </div>
  )
}

export default Detail
